  \"The effects of prairie management techniques, burning and mowing, on Iowa grassland
  breeding bird communities\",\n\t\"tracking_summary\": {\n\t\t\"total\": 20,\n\t\t\"recent\":
  0\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2016-07-27T22:19:27.733885\",\n\t\"name\": \"the-effects-of-prairie-management-techniques-burning-and-mowing-on-iowa-grassland-breeding\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This report investigates the effects of
  burning and mowing on the grassland breeding bird community of Neal Smith National
  Wildlife Refuge in central Iowa.  Two regions on the refuge were studied in this
  report- Area A and Area B, each of which were treated with identical plantings.
  \ Area A had not been burned, and one region of it was mowed in the spring.  Area
  B had not been mowed, and one region of it was burned in the spring before bird
  censusing.  Many of the avian species present in area A preferred the unmowed region
  to the mowed region.  Of the species present in Area B, the Dickcissel preferred
  the burned region.  The two unmowed, unburned regions in area A and B show significant
  differences in abundance in five of thirteen species.\",\n\t\"license_title\": \"License
